    name: "Example",
    tags: [
        "TerraformKeyTest",
        "TerraformKeyValueTest=TestValue",
    ],
}));
const _name_ = new dynatrace.ManagementZone("#name#", {
    entitySelectorBasedRules: [{
        enabled: true,
        selector: pulumi.interpolate`type("host"),entityId("${test.id}")`,
    }],
});
